import './index.css';
import React from 'react';



import {
    BrowserRouter,
    Route,
    Switch,
  } from 'react-router-dom'


  import Login from 'Login';
  import Register from 'Register';

  export default () => (
    <BrowserRouter>
      <Switch>
        <Route exact path="/login" render={props => <Login {...props} />} />
        <Route exact path="/Register" render={props => <Register {...props} />} />

      </Switch>
    </BrowserRouter>
  );
